import './css/App.css';
import React from 'react';
import Menu from './components/menu'
const context = React.createContext(false);

class App extends React.Component {


  render(){
    return (
      <context.Provider value={false}>
        <Menu />
      </context.Provider>
    )
}
}


export default App;
